//                "notes" => "<p>Did not turn up for first Boomtown shift on time, when phoned he said he didn&#39;t get the email but would set off asap. (10.8.15 ARE)</p>\r\n\r\n<p>Turned up for work ASAP, okay to work - JT</p>\r\n\r\n<p>DNR&#39;d by Matt Ginieres / Amy Jones at Big Feastival ( see below for statement from Matt)</p>\r\n\r\n<p>Joe Short booked into work as part of the Big Feastival production crew for 6 days of 86 hours work. He was due to begin work with Amy at 07=>00 on Tuesday 25th August, but rang Amy at 07=>15 saying he had overslept and still had to drive 1hr 45mins to site! On arrival, Amy took him aside to explain that he could not afford any more lateness and had to show full attention while at work within a production area and directly insight of our client and fellow contractors. It was a matter of minutes before I caught him leaning on a fence watching the world go by right outside the organisers office. I brought this to Amy&rsquo;s attention and he seemed better for the remainder of the shift. Both Amy and I decided that he would be more suitable positioned in the production car park for his next shift, away from plant and delivery movements.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Just after midday on the Thursday, I made my way through the site to find 20+ crew/production cars fly parked beyond the production car park, directly in front of the main pedestrian entrance into the arena (that would go live in 10 hours!). I quickly radio&rsquo;d this through to Amy, where she notified me that Joe was based in the area. Having a good look around, I could&rsquo;nt find him anywhere. Finally I discovered him laying in the car boot of his own vehicle playing on his phone. On questioning him on the fly parked cars in front of the arena entrance, he was completely oblivious. I returned to the office and informed Amy. I asked if she was comfortable firing him given she was his manager, and she was happy to oblige.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Amy mentioned that his response was that he &ldquo;didn&rsquo;t really care anyway&rdquo; and showed no remorse.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>I believe that Joe Short should be removed from our staffing database and not be booked in or work at any of our future events with immediate effect. He displayed no enthusiasm or desire to work and showed no emotion or responsibility for his actions. He would only cause further trouble for our supervisors and displays a poor representation of our company.</strong></p>\r\n"
